using System;
using System.IO;

namespace HK4E.HdiffBuilder.Tools;

public static class SevenZip {
    private const string sevenzipExe = """

""";

    private const string sevenzipDll1 = """

""";

    private const string sevenzipDll2 = """

""";

    public static string Extract() {
        string tempDir = Path.GetTempPath();
        string exePath = Path.Combine(tempDir, "7za.exe");
        string dll1Path = Path.Combine(tempDir, "7za.dll");
        string dll2Path = Path.Combine(tempDir, "7zxa.dll");

        if (!File.Exists(exePath))
            File.WriteAllBytes(exePath, Convert.FromBase64String(sevenzipExe));

        if (!File.Exists(dll1Path))
            File.WriteAllBytes(dll1Path, Convert.FromBase64String(sevenzipDll1));

        if (!File.Exists(dll2Path))
            File.WriteAllBytes(dll2Path, Convert.FromBase64String(sevenzipDll2));

        return exePath;
    }
}
